CREATE TABLE csv(
   policyID           INTEGER  NOT NULL PRIMARY KEY 
  ,statecode          VARCHAR(2) NOT NULL
  ,county             VARCHAR(11) NOT NULL
  ,eq_site_limit      NUMERIC(9,1) NOT NULL
  ,hu_site_limit      NUMERIC(10,2) NOT NULL
  ,fl_site_limit      NUMERIC(9,1) NOT NULL
  ,fr_site_limit      NUMERIC(9,1) NOT NULL
  ,tiv_2011           NUMERIC(10,2) NOT NULL
  ,tiv_2012           NUMERIC(10,2) NOT NULL
  ,eq_site_deductible INTEGER  NOT NULL
  ,hu_site_deductible NUMERIC(6,1) NOT NULL
  ,fl_site_deductible BIT  NOT NULL
  ,fr_site_deductible BIT  NOT NULL
  ,point_latitude     NUMERIC(9,6) NOT NULL
  ,point_longitude    NUMERIC(10,6) NOT NULL
  ,line               VARCHAR(11) NOT NULL
  ,construction       VARCHAR(19) NOT NULL
  ,point_granularity  INTEGER  NOT NULL
);
